nderstand (on a very high level): Production (dumb Marx), Consumption (genius Baudrillard) and Exchange (baka but hopefully interesting me).More specifically:Fine ancient mass-produced artwork.Sovereign currency.Music boxes, vinyl records.Photography/Renaissance art.Semiconductors/Chip making (it's going to sound weird but it's necessary to understand).Computers.Cameras.AI (on a very high level)."Social" Media.The Rat Utopia.There's a lot of topics to discuss, a lot of boundaries to cross. This is something I've been planning to write for a decade, but kicked the ball across as more pressing things kept coming to my desk (like meeting deadlines at work and in my studies...).Actually, I planned to write this over the last few days but I sadly got sick so I had to focus on some distraction, I settled on trying out ChatGPT o4 (I bought a pro license for a month even, I thought it was that dramatically good). At first I thought it was a waste of time, but it convinced me that my thesis was true and humanity is in great danger -- not for the reasons most think. It's an even worse scenario than Baudrillard envisioned and... well, let's just say I've just taken a long vacation to reflect on things and write it all down.Well, let me also just say this isn't going to be doom and gloom. I'm going to actually give you some solutions, solutions you already know but solutions none of us ever do. Solutions that can not only save your life but the lives of others around you. Perhaps if close friends of mine read it they can even save my own life*.Boy am I hyping this up! I guess I just hope you'll trust me and read through what I want to express, there are things in here you won't learn anywhere else. So wish me luck, I've got enough data/structure and will start writing (producing). All I ask is for distribution (propagation! haha) and ultimately your consideration (consumption -- f-fine, I'll stop now).I really hope I don't go insane from trying to merge so many different topics